%[text] - Automating Jobs \
%[text] ## Source control in MATLAB
%[text] MATLAB can work with GIT even if GIT is not installed in your system. **Most of GIT functionality is accessible from the MATLAB environment itself**
%[text] ### Are you familiar with **`git?`**
%[text] #### **`-> Yes!`**
%[text] You can run any git command from MATLAB like this!
!git help %[output:36ea3fc3]
%[text] or if you even want to lose the **`!`** you can create this function and add it to your path:
%[text] ```matlabCodeExample
%[text] function git(varargin)
%[text]   cmd = sprintf("git %s", strjoin(varargin, ' '));
%[text]   system(cmd);
%[text] end
%[text] ```
%%
%[text] ### -\> a little
%[text] If you are medium git user or you don't have git installed int your computer. You can use the MATLAB Integration for git to get easier access to some commands
repo = gitrepo %[output:43648562]
%[text] Other commands include
%[text] - **`commit`**
%[text] - **`push`**
%[text] - **`merge`**
%[text] - **`fetch`**
%[text] - **`pull`**
%[text] - **`...`** \
%[text] For more information visit [Git in MATLAB](https://uk.mathworks.com/help/releases/R2025a/matlab/matlab-git-source-control.html?s_tid=CRUX_lftnav)
%[text] **We would still recommend using** [**MATLAB Projects.**](https://uk.mathworks.com/help/releases/R2025a/matlab/projects.html)
%%
%[text] #### **`-> No!`**
%[text] Try using a [project](https://uk.mathworks.com/help/releases/R2025a/matlab/projects.html)!
%%
%[text] ### Cloning a repository
%[text] To get started, we are going to clone a repository with some instructions. There are several ways of doing this:
%[text] #### Via command line:
%[text] ```matlabCodeExample
%[text] !git clone https://github.com/ebenetce/AzureDevOpsDemo.git
%[text] ```
%[text] #### Via the MATLAB function
%[text] ```matlabCodeExample
%[text] repo = gitclone("https://github.com/ebenetce/AzureDevOpsDemo.git");
%[text] ```
%[text] #### Via the UI
%[text] ![](text:image:02d0)
%[text] This repository contains a Dynare model and a main file with instructions to understand how git, projects, and Azure DevOps works in MATLAB.
%%
%[text] ## MATLAB Projects
%[text] ### What is a MATLAB Project?
%[text] If you have been working with MATLAB, you probably have seen a model or a function that contains a README with instructions on how to run it which include some of these:
%[text] - addpath
%[text] - restoredefaultpath
%[text] - cd
%[text] - javaaddpath
%[text] - ... \
%[text] These are bad practice. **The project is adds some metadata around your code such that you can avoid all of the above.**
%[text] On top of that, the project will manage most of Git for you, and add you a bit of tooling to make the experience nicer.
%[text] ### Setting up a project
%[text] You can do it via the Desktop itself and just point it to the folder where you have the files:
%[text] ![](text:image:503f)
%[text] or directly from the command line:
prj = matlab.project.createProject('Folder',pwd, Name = 'MyNewModel') %[output:6df14f34]
%[text] What has this done:
%[text] 1. Added a **`MyNewModel.prj`**
%[text] 2. Added a "resources" folder with project metadata. You can ignore it but don't remove it.
%[text] 3. If you have a git repo, it added a **`.gitignore`** and **`.gitattributes`** files to help you manage your git repo
%[text] 4. All new files have been added to git. \
%[text] Let's commit and push those changes:
%[text] ```matlabCodeExample
%[text] repo = gitrepo()
%[text] commit(repo, Message = "Added project")
%[text] ```
%%
%[text] ### Open the project
%[text] After it has been crated, you always start here when you want to work in a project. You can also double click on the project file itself.
openProject('MyNewModel.prj');
%[text] This project has a Dynare model, which means it requires dynare to run. We could add a check on the project startup. For example:
%[text] ```matlabCodeExample
%[text] function MyModelStartup
%[text]   d = which('dynare');
%[text]   if isempty(d)
%[text]     warning('Please set dynare') % or addpath('dynare/matlab'); %or matlab.addons.install('dynare ...)
%[text]   end 
%[text] end
%[text] ```
%[text] 
%[text] ![](text:image:7a24)
%%
%[text] ## Best practices with GIT and Projects
%[text] Our model is currently not running, if we call the following command:
dynare Smets_Wouters_2007_45.mod nolog %[output:111a9cfe] %[output:7734f1e7]
%[text] we will see that the current model is missing a function, the task will be to add this function and merge the changes back into the repository. Normally, you don't work on the main branch. You follow this process:
%[text] 1. Create a branch (a copy of the code at the current state).
%[text] 2. Make the changes in the branch
%[text] 3. Bring the changes back to the "main branch". This is called merge
%[text] 4. Resolve any conflicts if the "main branch" has changed in the middle. \
%%
%[text] ### Create a branch
%[text] As usual, we can do this from either the UI or from the command line, whichever is easier for everyone:
!git branch %[output:15f3b3ef]
%[text] ![](text:image:8e5d)
%%
%[text] Sync the branch to the server:
!git commit -am "Added project"
!git push --set-upstream origin AddFile
%%
%[text] ### Add a function
%[text] The first thing we want to do, is to add a function to this project.
mkdir src
websave('src/PC_slope.m', "https://raw.githubusercontent.com/JohannesPfeifer/DSGE_mod/refs/heads/master/Smets_Wouters_2007/PC_slope.m") %[output:5d654650]
%[text] Try calling that function
%[text] ```matlabCodeExample
%[text] PC_slope()
%[text] ```
%[text] It does not work. That is expected. In the past this was solved by either of these two approaches:
%[text] 1. Put all the files in the current folder.
%[text] 2. Have a set of commands of this type at the start (**`addpath('src')`**). \
%[text] We have a project now, so you can add the folder to the project path and the project will make that function available as long as it is open:
%[text]  ![](text:image:8b19)
%[text] Try calling the function now when the project is open and closed. You will see the difference:
%[text] **Bonus: The file has been added to git for you!**
%[text] Let's commit the changes!
%[text] ```matlabCodeExample
%[text] repo = gitrepo()
%[text] commit(repo, Message = "New function") % !git -am commit -am "New Function"
%[text] ```
%[text] ### Run the model
%[text] And add it to your project. This will sync our Git repo automatically:
dynare Smets_Wouters_2007_45.mod nolog %[output:98ddfb6a] %[output:4753315c]
%%
%[text] ### Write a test?
%[text] It is a good practice to write tests once things are working, so we don't break them accidentally:
%[text] ```matlabCodeExample
%[text] classdef tModel < matlab.unittest.TestCase
%[text] 
%[text]     methods (Test)
%[text] 
%[text]         function tSWModel(tc)
%[text] 
%[text]             prj = currentProject();
%[text]             cd(prj.RootFolder)
%[text]             dynare Smets_Wouters_2007_45.mod nolog
%[text]             tc.verifyTrue(isfile('Smets_Wouters_2007_45/Output/Smets_Wouters_2007_45_results.mat'))
%[text]             
%[text]         end
%[text] 
%[text]     end
%[text] 
%[text] end
%[text] ```
runtests
%%
%[text] ### Tidy up and push
%[text] ![](text:image:1cbb)
!git push --set-upstream origin AddFile
%%
%[text] ### Merge to main
%[text] There are many ways to merge the changes back into main. You can do it from the branch manager directly in MATLAB and then push the changes..
%[text] ![](text:image:87db)
%[text] Or you can create a merge requests in GitHub and then **`pull`** the changes here:
%[text] ![](text:image:7aca)
%[text] We now have a working model merged into the main branch, is time to move back to main and pull the changes!
!git switch main
!git pull
%%
%[text] ## Connect to Azure DevOps
%[text] Connecting to Azure DevOps or any other CI platform is trivial. You simply need to add the corresponding YML file with the pipeline instructions. For details on most CI platforms visit the page below:
%[text] [Continuous Integration with MATLAB on CI Platforms - MATLAB & Simulink](https://uk.mathworks.com/help/matlab/matlab_prog/continuous-integration-with-matlab-on-ci-platforms.html)
%[text] However, for Azure DevOps you can do as follows:
%[text] **`azure-pipelines.yml`**
%[text] ```
%[text] # Starter pipeline
%[text] # Start with a minimal pipeline that you can customize to build and deploy your code.
%[text] # Add steps that build, run tests, deploy, and more:
%[text] # https://aka.ms/yaml
%[text] 
%[text] trigger:
%[text] - main
%[text] 
%[text] pool:
%[text]   name: Default
%[text] 
%[text] steps:
%[text] - script: matlab -batch "openProject('MyNewModel.prj'); main"
%[text]   displayName: 'Run a one-line script'
%[text] 
%[text] - task: PublishBuildArtifacts@1
%[text]   displayName: 'Publish MyReport.docx as artifact'
%[text]   inputs:
%[text]     PathtoPublish: 'reporting/MyReport.docx'
%[text]     ArtifactName: 'MyReport'
%[text]     publishLocation: 'Container'
%[text] ```
%[text] ## Complete the full workflow
